var instance_skel = require('../../instance_skel');
var tcp           = require('../../tcp');
var debug;
var log;

function instance(system, id, config) {
	var self = this;

	// super-constructor
	instance_skel.apply(this, arguments);

	self.init_presets();	// init presets

	return self;
}

instance.prototype.updateConfig = function(config) {
	var self = this;
	self.init_presets();

  if (self.socket !== undefined) {
  		self.socket.destroy();
  		delete self.socket;
  }

	self.config = config;

	self.init_tcp();

}

instance.prototype.init = function() {
	var self = this;

	self.init_presets();
	self.status(self.STATE_OK);
  self.init_tcp();

	debug = self.debug;
	log = self.log;
}

instance.prototype.init_tcp = function() {
	var self = this;

	if (self.socket !== undefined) {
		self.socket.destroy();
		delete self.socket;
	}

	self.status(self.STATE_WARNING, 'Connecting');

	if (self.config.host) {
		self.socket = new tcp(self.config.host, self.config.port);

		self.socket.on('status_change', function (status, message) {
			self.status(status, message);
		});

		self.socket.on('error', function (err) {
			debug("Network error", err);
			self.status(self.STATE_ERROR, err);
			self.log('error',"Network error: " + err.message);
		});

    self.socket.on('data', function(data) {
       self.log('debug','Received: ' + data);
    });

		self.socket.on('connect', function () {
			self.status(self.STATE_OK);
			debug("Connected");
		})

		self.socket.on('data', function (data) {});
	}
};

// Return config fields for web config
instance.prototype.config_fields = function () {
	var self = this;
	return [
		{
			type: 'text',
			id: 'info',
			label: 'Information',
			width: 12,
			value: `
				<div class="alert alert-info">
					<h3>IMPORTANT MESSAGE</h3>
					<div>
						<strong>Please read and understand the following before using this module</strong>
						<p>
						The companion project started out as an attempt to make the everyday life of a technician easier.<br/>
						</p>
						<p>
						This module works with the New MediaMaster 6 software in player Mode.<br/>
						You can control the remote player on the MediaHub of MediaMaster 6 (ArKaos) with the presets</p>
					</div>
				</div>
			`
		},		
		{
			type: 'text',
			id: 'info',
			width: 12,
			label: 'Information',
			value: 'For this module to work, please in MediaMaster activate the remote player'
		},
		{
			type: 'textinput',
			id: 'host',
			label: 'Target IP',
			width: 6,
			default: '127.0.0.1',
			regex: self.REGEX_IP
		},
    {
			type: 'textinput',
			id: 'port',
			label: 'Target Port',
			width: 2,
			default: 45678 ,
			regex: self.REGEX_PORT
		}
	]
}

// When module gets deleted
instance.prototype.destroy = function() {
	var self = this;
  if (self.socket !== undefined) {
		self.socket.destroy();
	}
	debug("destroy");
}

