instance.prototype.init_presets = function () {
	var self = this;
	var presets = [];
	var pstSize = (this.config.presets == 1 ? 'auto' : '14')

	for (var input in self.CHOICES_COMMANDS) {
		if(self.CHOICES_COMMANDS[input].image){
			presets.push({
				category: 'Commands',
				label: self.CHOICES_COMMANDS[input].label,
				bank: {
					style: 'png',
					text: '',
					png64: self.CHOICES_COMMANDS[input].image,
					pngalignment: 'center:center',
					size: '14',
					color: '16777215',
					bgcolor: self.rgb(0,0,0),
	
				},
				actions: [{
					action: self.CHOICES_COMMANDS[input].cmd,
				}]
			});	
		}else{
			presets.push({
				category: 'Commands',
				label: self.CHOICES_COMMANDS[input].label,
				bank: {
					style: 'text',
					text: self.CHOICES_COMMANDS[input].label,
					size: pstSize,
					color: '16777215',
					bgcolor: 0
				},
				actions: [{
					action: self.CHOICES_COMMANDS[input].cmd,
				}]
			});
	
		}
	}

	self.setPresetDefinitions(presets);
}

instance.prototype.action = function(action) {
	var self = this;
	self.log('debug','action: '+action.action);
	var cmd = action.action;
  	cmd += "\r\n";

  if (self.socket !== undefined && self.socket.connected) {
  		self.socket.send(cmd);
        self.log('debug','sending '+cmd+ ' to '+self.config.host);
  }
  else {
  			debug('Socket not connected :(');
  }
}

instance_skel.extendedBy(instance);
exports = module.exports = instance;
